tables.table_schema:
CREATE TABLE ar_object_interactions (
    id INT PRIMARY KEY,
    ar_object_id INT,
    user_id INT,
    interactions TEXT
);

CREATE TABLE user_analytics (
    id INT PRIMARY KEY,
    user_id INT,
    action_type TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE ar_objects (
    ar_object_id INT PRIMARY KEY,
    ar_object_name VARCHAR(50),
    ar_object_type VARCHAR(50),
    ar_object_interaction_count INT
);

CREATE TABLE user_analytics (
    user_id INT PRIMARY KEY,
    total_interactions INT,
    average_interaction_time INT,
    distinct_ar_objects_interacted INT
);
